import api from "../utils/api";
import { useQuery } from "@tanstack/react-query";
export const useMovieGenreQuery = () => {
    const fetchMovieGenre = () => {
        return api.get(`/gentre/movie/list`);
    };

    return useQuery({
        queryKey: ["movie-genre"],
        queryFn: fetchMovieGenre,
    });
};
